import Draggable from 'react-draggable';
import {Modal,message,Button} from 'antd';
import {PhoneOutlined} from '@ant-design/icons';
import {LoginWrapper,LoginLeft,LoginRight} from './style';
import LoginIcon from 'components/theme-controls-icon/login';

function ThemeLogin(){

    // JSX
    const defaultWrapperContent = (
        <LoginWrapper>
            <LoginLeft>
                <div className='login-content'>
                    <div className='login-bg'></div>
                    <Button
                        type="primary"
                        icon={<PhoneOutlined/>}

                    >
                        手机号登录
                    </Button>
                    <Button
                        type='ghost'
                        icon={<PhoneOutlined />}
                        className="gap"
                    >
                        注册
                    </Button>
                </div>
            </LoginLeft>
            <LoginRight>
                <div className='icons-wrapper'>
                    <LoginIcon
                        onClick={() => message.warn('暂未开通')}
                        position="-150px -670px"
                        description="微信登录"
                    />
                    <LoginIcon
                        onClick={() => message.warn('暂未开通')}
                        position="-190px -670px"
                        description="QQ登录"
                    />
                    <LoginIcon
                        onClick={() => message.warn('暂未开通')}
                        position="-231px -670px"
                        description="微博登录"
                    />
                    <LoginIcon
                        onClick={() => message.warn('稍后')}
                        position="-271px -670px"
                        description="网易邮箱登录"
                    />

                </div>
            </LoginRight>
        </LoginWrapper>
    );


    return (
        <div>
            <Modal
                centered={true}
                footer={null}
                visible={true}
            >
                {defaultWrapperContent}
            </Modal>
        </div>
    );
}

export default ThemeLogin;
